import React from 'react';
import useForm from './customHooks';
import {MenuItem,Select,Radio,FormControl,FormLabel,RadioGroup,Grid,Accordion,Typography,Paper,Box,Link,Checkbox,TextField,Button,FormControlLabel,AccordionSummary,Slider, Divider} from '@material-ui/core';

export default function  Form () {
    const {inputs, handleInputChange, handleSubmit} = useForm({paciente:{"edad":""},password:''});
    return (
      <form onsubmit="{handleSubmit}">
        <div>
          <label>Email Address</label>
          <TextField  name="email" onchange="{handleInputChange}" value="{inputs.paciente.edad}" required="" />
        </div>
        <div>
          <label>Password</label>
          <TextField name="password" onchange="{handleInputChange}" value="{inputs.password}" required="" />
        </div>
        <button type="submit">Submit</button>
      </form>
    )
}
